import React from 'react';

const RestaurantManagementPage = () => {
  return (
    <div className="min-h-screen flex">
      {/* Sidebar */}
      <div className="bg-gradient-to-r from-white via-yellow-200 to-orange-400 text-white w-64 flex-shrink-0 p-4">
        <h1 className="text-3xl font-bold mb-4">Restaurant Management</h1>
        <ul className="space-y-2">
          <li className="hover:bg-yellow-300 p-2 rounded transition duration-300">
            <a href="#" className="flex items-center">
              <span className="text-yellow-600">
                <i className="fas fa-utensils mr-2"></i>
              </span>
              Menu Items
            </a>
          </li>
          <li className="hover:bg-yellow-300 p-2 rounded transition duration-300">
            <a href="#" className="flex items-center">
              <span className="text-yellow-600">
                <i className="fas fa-store-alt mr-2"></i>
              </span>
              Restaurants
            </a>
          </li>
          {/* Add more sidebar items as needed */}
        </ul>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-8 bg-gradient-to-r from-white via-yellow-200 to-orange-400">
        <h2 className="text-4xl font-bold mb-6">
          Welcome to Restaurant Management
        </h2>
        {/* Add more content and styling as needed */}
      </div>
    </div>
  );
};

export default RestaurantManagementPage;
